(4, 1, 'About', '&lt;h1 style=&quot;margin-bottom: 20px;&quot;&gt;About Us&lt;/h1&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 10px;&quot;&gt;&lt;strong&gt;It Started With A Husband and Wife Team&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;Meet Arthur, a MIT-trained rocket scientist, and his wife, Caecilia, a Harvard-educated business woman and an expectant mother. TheBabyShop.com is their wish to bring the European boutique shopping experience right at the fingertips of all busy, caring parents in Asia.&lt;/p&gt;\r\n\r\n&lt;p&gt;Think of it as a wander down the Champs-Élysées in Paris, a flying trip to London or Rome, wherever you want, all to give your family the very best. We feature more than 50 of Europe’s premium boutique brands of children clothing, toys, and bedroom accessories. Be it a newborn toy gift, or a fashionable clothing style, or beautiful accessories for the children’s room, we offer you and your precious little ones the very best items all year round.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img alt=&quot;&quot; src=&quot;/image/data/information/thebabyshop_founders_web.jpg&quot; style=&quot;width: 500px; &quot; /&gt;&lt;/p&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 10px;&quot;&gt;&lt;strong&gt;Products We Love&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;We searched the world for products and decidedly fell in love with European labels. Their sense of culture, craftsmanship, and aestheticism makes them unique.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our toys are fun and educational. They’re classic, often reminding parents how they used to play. These are toys that use natural materials such as wood and cotton, encouraging children to play freely, all the while helping them achieve important developmental goals.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our range of clothing is designed for children but has a certain adult elegance to it: the kind of looks we imagine our children will wear once they’ve grown up. The styles we like are often unique and make use of luxury materials – including cashmere, alpaca wool, and pima cotton to ensure comfort and softness for the little ones..&lt;/p&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 10px;&quot;&gt;&lt;strong&gt;Safety and Quality Guarantee&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;All our toys adhere to the strictest European (EN-71) and international safety standards. They are tested in independent labs and all have passed the strict standards necessary to be sold in European countries.&lt;/p&gt;\r\n\r\n&lt;p&gt;Our organic cotton clothing and toys are certified by the Global Organic Textile Standard (GOTS). This is a premium level of quality assurance that parents can trust.&lt;/p&gt;\r\n\r\n&lt;p&gt;We guarantee that 100% of our products meet or exceed the highest safety and quality standards demanded by the European Union.&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;a href=&quot;/&quot;&gt;&amp;lt; Back to Homepage&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Any questions? TheBabyShop.com Customer Support Team is here to help, 9 am to 5:30 pm, Monday to Friday&lt;br /&gt;\r\n(excluding public holidays).&amp;nbsp;Email &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; or call us at (+852) 2812-2223.&lt;/p&gt;\r\n', '', '', ''),
(8, 1, 'Safety', '&lt;h1 style=&quot;margin-bottom: 20px;&quot;&gt;Product Safety&lt;/h1&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 20px;&quot;&gt;We take this seriously so you don’t have to worry.&lt;/h2&gt;\r\n\r\n&lt;p&gt;Products you buy for your baby or child should be stylish and fun. They should also be full of potential, helping kids to express themselves and develop as they grow. But above all, they need to be something you can trust.&lt;/p&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 20px;&quot;&gt;Completely.&lt;/h2&gt;\r\n\r\n&lt;p&gt;We never compromise on product safety nor product quality. We always insist on the very highest standards. We know that you feel exactly the same way.&lt;/p&gt;\r\n\r\n&lt;p&gt;Which means that you can trust in the quality and safety of every single item you find at TheBabyShop.com&lt;/p&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 20px;&quot;&gt;Product safety is our number one promise to you.&lt;/h2&gt;\r\n\r\n&lt;p&gt;Much of the clothing we offer is made from 100%, non-allergic cotton – that means softness and comfort is a given. Many items are also totally organic, so you know that baby is getting only the best.&lt;/p&gt;\r\n\r\n&lt;p&gt;What’s more, all of our toys exceed the most rigorous international safety standards*. And we only work with manufacturers who insist on the same high standards that we do.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you have any questions about the quality or safety of our products, or the international safety standards that we stand by, we’re always happy to provide you with answers. Please email us at &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;small&gt;* All of our toys have passed the EN-71 safety standard in Europe. The majority of them have also passed the ASTM safety standard in the USA. In order to pass these safety standards, each toy must go through comprehensive mechanical and chemical testing, use age appropriate labeling, and pass a series of other important child safety measures.&lt;/small&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/&quot;&gt;Go to Homepage&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Any questions? The Baby Shop Customer Support Team is here to help, 9 am to 5:30 pm, Monday to Friday&lt;br /&gt;\r\n(excluding public holidays).&lt;br /&gt;\r\nEmail &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; or call us at 2812-2223.&lt;/p&gt;\r\n', '', '', ''),
(7, 1, 'Products We Love', '&lt;h1 style=&quot;margin-bottom: 20px;&quot;&gt;Products We Love&lt;/h1&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 20px;&quot;&gt;We only stock brands that we believe in.&lt;/h2&gt;\r\n\r\n&lt;p&gt;From the best in contemporary design, to that timeless tradition of only making things by hand – we trust in the clothes and toys that we choose. Whether it’s the eye-catching styling of chic dresses and tops, or toys that support your little ones’ development as they grow, we love everything you’ll find at TheBabyShop.com&lt;/p&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 20px;&quot;&gt;100%&lt;/h2&gt;\r\n\r\n&lt;p&gt;We love fashion brands like Emile et Ida, who put a fresh spin on vintage English styles. Or Spanish shoemaker Manuela de Juan – a firm favourite of international celebrity mums like Angelina Jolie, Monica Bellucci and Jessica Alba.&lt;/p&gt;\r\n\r\n&lt;p&gt;And we adore toymakers like Germany’s Kathe Kruse – whose namesake decided, way back in 1905, that she could make a doll for her three-year-old daughter, one far better than anything she could buy. Or Italy’s Trudi, who sprang to life in 1954 when teenager Trudi Müller Patriarca began making soft toys for her friends.&lt;/p&gt;\r\n\r\n&lt;p&gt;Every brand that we bring to you has a story to tell.&lt;/p&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 20px;&quot;&gt;We love that.&lt;/h2&gt;\r\n\r\n&lt;p&gt;At the BabyShop.com you’ll find all of our products grouped into categories that are easy to understand. We have fashionable clothing with beautiful, delightful, original styles, as well as baby accessories that will make life easier and more colourful for you and your little one. Our wide range of toys and games runs from cot mobiles to toys that help develop your child’s sensory or motor skills. Everything here has been carefully designed to make your busy life as easy as possible. We know that all you really want to do is spend your precious time with your child, not waste it online.&lt;/p&gt;\r\n\r\n&lt;p&gt;And of course, if you’re looking for the perfect gift for friends or family who are celebrating a new arrival, we’ve a great selection for you. And to save you trouble to wrap the gift you bought, we include a gift-wrapping service that’s completely free of charge.&lt;/p&gt;\r\n', '', '', ''),
(10, 1, 'Customer Service', '&lt;h1&gt;Customer Service&lt;/h1&gt;\r\n\r\n&lt;h2&gt;Our added extras.&lt;/h2&gt;\r\n\r\n&lt;h2&gt;FREE gift wrapping service:&lt;/h2&gt;\r\n\r\n&lt;p&gt;There’s no need to worry about wrapping your gifts. We’ll do it for you. Completely FREE of charge.&lt;/p&gt;\r\n\r\n&lt;p&gt;Click on &lt;u&gt;Free Gift Wrapping&lt;/u&gt; to learn more.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;FREE shipping &amp;amp; returns:&lt;/h2&gt;\r\n\r\n&lt;p&gt;We ship to anywhere in Hong Kong, including the Outlying Islands – 100% FREE.&lt;/p&gt;\r\n\r\n&lt;p&gt;Your satisfaction is vital to us. You can return any purchase – whatever the reason. And there’s nothing complicated about it. We have a simple 30-day return policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;Click on &lt;u&gt;Shipping &amp;amp; Returns&lt;/u&gt; to learn more.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Frequently Asked Questions:&lt;/h2&gt;\r\n\r\n&lt;p&gt;For answers to he most commonly asked questions, please visit &lt;u&gt;Frequently Asked Questions&lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/&quot; style=&quot;font-size: 13px;&quot;&gt;Go to Homepage&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Any questions? The Baby Shop Customer Support Team is here to help, 9 am to 5:30 pm, Monday to Friday (excluding public holidays).&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;Email &lt;a alt=&quot;Customer Supper at The Baby Shop&quot; href=&quot;customers@thebabyshop.com&quot;&gt;customers@thebabyshop.com&lt;/a&gt; or call us at (+852)&amp;nbsp;2812-2223.&lt;/p&gt;\r\n', '', '', ''),
(11, 1, 'Gift Wrap', '&lt;h1&gt;FREE Gift Wrapping&lt;/h1&gt;\r\n\r\n&lt;h2&gt;Let us do the gift&amp;nbsp;wrapping for you.&lt;/h2&gt;\r\n\r\n&lt;p&gt;No need to worry about putting that special finishing touch to your gift. Select the “Gift&amp;nbsp;Wrap” option on the checkout page and we''ll do the work for you.&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;img alt=&quot;&quot; src=&quot;/image/data/information/thebabyshop_gifts.jpg&quot; style=&quot;width:500px;&quot; /&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;If you provide a message to us, we will print out your message on a nice gift card that comes with the gift order.&lt;/p&gt;\r\n\r\n&lt;p&gt;For every order, we don’t print item prices in the packing list. That means that you can send your gift directly, without worrying about your recipients seeing the price.&lt;/p&gt;\r\n\r\n&lt;div&gt;\r\n&lt;hr style=&quot;font-size: 13px; &quot; /&gt;\r\n&lt;p style=&quot;font-size: 13px; &quot;&gt;&lt;a href=&quot;/&quot;&gt;&amp;lt; Back to Homepage&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; &quot;&gt;Any questions? TheBabyShop.com Customer Support Team is here to help, 9 am to 5:30 pm, Monday to Friday&lt;br /&gt;\r\n(excluding public holidays).&amp;nbsp;Email&amp;nbsp;&lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt;&amp;nbsp;or call us at (+852) 2812-2223.&lt;/p&gt;\r\n&lt;/div&gt;\r\n', '', '', ''),
(12, 1, 'Payment', '&lt;h1&gt;Payment &amp;amp; Security&lt;/h1&gt;\r\n\r\n&lt;p&gt;TheBabyShop.com offers a wide range of payment methods. Choose the way that you would like to pay.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Payment Option 1: Credit Card&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Payment on TheBabyShop.com is secure. We accept VISA, MasterCard, and American Express. We utilise the PayPal technology platform as our main credit card payment gateway for processing each credit card transaction. PayPal’s credit card payment gateway is the gold standard for credit card transaction globally. PayPal is PCI-compliant, which means the system is highly secure at protecting your payment and credit card information according to the highest international standards for internet security.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Payment Option 2: PayPal direct payment&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;PayPal is an international account-based system that lets anyone with an email address to securely send and receive online payments. To make a direct payment through PayPal, you first need to open an account with PayPal. Please visit &lt;a href=&quot;//www.paypal.com/&quot;&gt;www.paypal.com&lt;/a&gt; for detailed information on how to create an account and make payment. Please note that you do not need to open or use a PayPal account if you are using your credit card for payment on our website.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Currencies&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;H.K. dollars and U.S. dollars are both accepted as transaction currencies.&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;a href=&quot;/&quot;&gt;&amp;lt; Back to Homepage&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Any questions? TheBabyShop.com Customer Support Team is here to help, 9 am to 5:30 pm, Monday to Friday&lt;br /&gt;\r\n(excluding public holidays).&amp;nbsp;Email &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; or call us at (+852) 2812-2223.&lt;/p&gt;\r\n', '', '', ''),
(14, 1, 'Partners', '&lt;p&gt;Partners&lt;/p&gt;\r\n', '', '', ''),
(3, 1, 'Privacy', '&lt;h1&gt;Privacy Policy&lt;/h1&gt;\r\n\r\n&lt;p&gt;The Baby Shop International Limited (“The Baby Shop” or “Baby Shop” or “We”), respects your concerns about privacy. This Privacy Policy describes the types of personal information we collect, how we use the information, with whom we share it, and the choices you can make about our collection, use and disclosure of the information. We also describe the measures we take to protect the security of the information and how you can contact us about our privacy practices.&lt;/p&gt;\r\n\r\n&lt;p&gt;The phrase “personal information” refers to information by which you or the device you are using to connect to the Internet can be identified.&lt;/p&gt;\r\n\r\n&lt;p&gt;We may obtain personal information about you from various sources, including this Baby Shop website, mobile applications, when you call or email us or communicate with us through social media, or when you participate in events or other promotions. We also may obtain information about you from our business partners and other third parties.&lt;/p&gt;\r\n\r\n&lt;p&gt;The types of personal information we may obtain and keep in The Baby Shop’s database include:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Your contact information, Facebook information, web usage information, and customer transaction histories.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;The types of personal information we may obtain and but not keep in The Baby Shop’s database include:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Payment details (including payment card number, security code, expiration date)&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;In addition, when you visit our websites or use our mobile applications, we may collect certain information by automated means, such as cookies and web beacons. A “cookie” is a text file that websites send to a visitor‘s computer or other Internet-connected device to uniquely identify the visitor’s browser or to store information or settings in the browser. A “web beacon,” also known as an Internet tag, pixel tag or clear GIF, is used to transmit information back to a web server. We also may use third-party website analytics tools (such as Omniture or Google), that collect information about visitor traffic on our sites and mobile applications.&lt;/p&gt;\r\n\r\n&lt;p&gt;We may use the information we obtain about you to:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Register you for membership / user account at our websites&lt;/li&gt;\r\n	&lt;li&gt;Process, validate, confirm, verify, deliver and track your purchases (including by processing payment card transactions, arranging shipping and handling returns and refunds, and contacting you about your orders, including by telephone)&lt;/li&gt;\r\n	&lt;li&gt;Respond to your questions and comments and provide customer support&lt;/li&gt;\r\n	&lt;li&gt;Communicate and tailor our products, services, offers, events and promotions we believe may be of interest to you&lt;/li&gt;\r\n	&lt;li&gt;Protect against and prevent fraud, unauthorized transactions, claims and other liabilities, and manage risk exposure, including by identifying potential hackers and other unauthorized users&lt;/li&gt;\r\n	&lt;li&gt;Comply with applicable legal requirements and industry standards and our policies&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;h2&gt;INFORMATION WE SHARE&lt;/h2&gt;\r\n\r\n&lt;p&gt;We do not sell or otherwise disclose personal information about you, except as described in this Privacy Policy.&lt;/p&gt;\r\n\r\n&lt;p&gt;We may disclose information about you (i) if we are required to do so by law or legal process (such as a court order), (ii) in response to a request by law enforcement authorities, or (iii) when we believe disclosure is necessary or appropriate to prevent physical harm or financial loss or in connection with an investigation of suspected or actual illegal activity.&lt;/p&gt;\r\n\r\n&lt;h2&gt;LINKS TO OTHER WEBSITES&lt;/h2&gt;\r\n\r\n&lt;p&gt;Our websites may contain links to other sites for your convenience and information. These sites may be operated by companies not affiliated with The Baby Shop. Linked sites may have their own privacy policies, which you should review if you visit those websites. We are not responsible for the content of any websites not affiliated with The Baby Shop, any use of those sites, or those sites’ privacy practices.&lt;/p&gt;\r\n\r\n&lt;h2&gt;HOW WE PROTECT PERSONAL INFORMATION&lt;/h2&gt;\r\n\r\n&lt;p&gt;We maintain administrative, technical and physical safeguards designed to assist us in protecting the personal information we collect against accidental, unlawful or unauthorized destruction, loss, alteration, access, disclosure or use. For example, we use Secure Sockets Layer encryption to protect certain of your purchase information while in transit.&lt;/p&gt;\r\n\r\n&lt;p&gt;Please note that no electronic transmission of information can be entirely secure. We cannot guarantee that the security measures we have in place to safeguard personal information will never be defeated or fail, or that those measures will always be sufficient or effective.&lt;/p&gt;\r\n\r\n&lt;p&gt;To further protect yourself, you should safeguard your Baby Shop account and password and not share that information with anyone. Please note that we will never ask for your Baby Shop account user name or password via email.&lt;/p&gt;\r\n\r\n&lt;p&gt;For additional details about the security measures we have implemented to safeguard personal information, please see our Payment &amp;amp; Security section of this Baby Shop website..&lt;/p&gt;\r\n\r\n&lt;h2&gt;CHILDREN’S PRIVACY&lt;/h2&gt;\r\n\r\n&lt;p&gt;The Baby Shop requires registered users of the site to be at least eighteen years old. If we learn that a user is under eighteen years of age, we will delete any personal information that the individual has provided to us.&lt;/p&gt;\r\n\r\n&lt;h2&gt;UPDATES TO THIS PRIVACY POLICY&lt;/h2&gt;\r\n\r\n&lt;p&gt;This Privacy Policy may be updated periodically and without prior notice to you to reflect changes in our personal information practices. We will post a prominent notice on our websites to notify you of any significant changes to our Privacy Policy and indicate at the bottom of the notice when it was most recently updated.&lt;/p&gt;\r\n\r\n&lt;h2&gt;HOW TO CONTACT US&lt;/h2&gt;\r\n\r\n&lt;p&gt;If you have any questions or comments about this Privacy Policy, or if you would like us to update information we have about you or your preferences, please contact us by email at &lt;a href=&quot;mailto:support@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt;. You also may write to us at:&lt;/p&gt;\r\n\r\n&lt;p&gt;Attn: Customer Service Team&lt;/p&gt;\r\n\r\n&lt;p&gt;The Baby Shop International Limited&lt;/p&gt;\r\n\r\n&lt;p&gt;Suite 903-904, 9/F&lt;br /&gt;\r\n69 Jervois Street&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;span style=&quot;line-height: 1.6em;&quot;&gt;Sheung Wan, Hong Kong&lt;/span&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;small&gt;Effective Date: June 21, 2013&lt;/small&gt;&lt;/p&gt;\r\n', '', '', ''),
(15, 1, 'Returns', '&lt;h1&gt;Returns Guarantee&lt;/h1&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Easy returns with TheBabyShop.com&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;We want you to have a great online shopping experience. Every time.&lt;/p&gt;\r\n\r\n&lt;p&gt;Every customer can return any purchase, for whatever reason, for a refund from The Baby Shop.&lt;/p&gt;\r\n\r\n&lt;p&gt;Find out more detailed returns steps at &lt;u&gt;Returns Instructions&lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Our 30-day returns policy has no catches, no exceptions. All we ask is that you fill in your send the items back to us in the original packaging with product tags attached, and make sure that the merchandise is in the same condition you received it in. Remember:&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Once your return is received and checked by us, your Baby Shop refund will be processed at an expedient manner if approved.&lt;/li&gt;\r\n	&lt;li&gt;As part of our 30-day returns policy, all returns should be shipped back to us within 30 days of purchase.&lt;/li&gt;\r\n	&lt;li&gt;Please do not send your purchase back to the manufacturer.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;Please note that if this item is a gift from somebody, as the recipient of the gift, you are only eligible for returns if the product arrives damaged or defective. In that case, please follow the standard return procedures. We would then send you a new product in return.&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Simple steps to return purchases&lt;/strong&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Here''s what you need to do:&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;u&gt;Step 1: Fill Out Return Slip&lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;There is a Return Slip inside the package you received. Please fill out all the information.&lt;/li&gt;\r\n	&lt;li&gt;If you lost your Return Slip, you can &lt;strong&gt;&lt;a alt=&quot;Return Slip&quot; href=&quot;/download/return_slip.pdf&quot; target=&quot;_blank&quot;&gt;click here to download&lt;/a&gt;&lt;/strong&gt; and print out.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;u&gt;Step 2: Prepare Package&lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Please then pack both the Return Slip and the merchandise that you would to return.&lt;/li&gt;\r\n	&lt;li&gt;For the return mail packaging, you can use the original TheBabyShop.com mail packaging you received, or any plain, unmarked cardboard box or mailing parcels. If there are existing shipping labels, stickers, or other materials on the shipping box, please remove them.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;&lt;u&gt;Step 3: Ship It&lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;ul&gt;\r\n	&lt;li&gt;Finally, please just ship it with any postal or courier services. The return address is located at the bottom section of the Return Slip.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n\r\n&lt;p&gt;That’s it. Please contact us anytime if you have any trouble or concerns with returning your merchandise.&lt;/p&gt;\r\n\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;a href=&quot;/&quot;&gt;&amp;lt; Back to Homepage&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Any questions? TheBabyShop.com Customer Support Team is here to help, 9 am to 5:30 pm, Monday to Friday&lt;br /&gt;\r\n(excluding public holidays).&amp;nbsp;Email &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; or call us at (+852) 2812-2223.&lt;/p&gt;\r\n', '', '', ''),
(16, 1, 'Contact Us', '&lt;h1 style=&quot;margin-bottom: 20px;&quot;&gt;Contact Us&lt;/h1&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 10px;&quot;&gt;We’re here to help.&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Email The Baby Shop Customer Support Team:&lt;/strong&gt;&lt;br /&gt;\r\nWe’re always happy to hear from you and look forward to helping you with any inquiry. We respond to email messages in the order that they are received, as quickly as possible. Feel free to email us at &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Call us:&lt;/strong&gt;&lt;br /&gt;\r\nWe’re here for you. Please give us a call at (+852) 2812-2223 during our regular business hour (9 am to 5:30 pm, Monday to Friday). If we’re unable to take your call immediately, especially during holidays, simply leave us a voice message, including your contact number, and we’ll get back to you as soon as we can.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Frequently Asked Questions:&lt;/strong&gt;&lt;br /&gt;\r\nFor answers to the most commonly asked questions, please visit our&amp;nbsp;&lt;a href=&quot;/faqs&quot;&gt;&lt;u&gt;FAQs&lt;/u&gt;&lt;/a&gt; section.&lt;/p&gt;\r\n\r\n&lt;h2 style=&quot;margin-bottom: 10px;&quot;&gt;Additional inquiries:&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Press inquiries:&lt;/strong&gt;&lt;br /&gt;\r\nPlease direct all media to: &lt;a href=&quot;mailto:marketing@thebabyshop.com&quot;&gt;marketing@thebabyshop.com&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;strong&gt;Partnership inquiries:&lt;/strong&gt;&lt;br /&gt;\r\nInterested in becoming our partner and featuring your brand on our website? Or do you want to conduct business or advertising partnerships? Please direct all partnership inquiries to: &lt;a href=&quot;mailto:partners@thebabyshop.com&quot;&gt;partners@thebabyshop.com&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;div&gt;\r\n&lt;hr style=&quot;font-size: 13px; &quot; /&gt;\r\n&lt;p style=&quot;font-size: 13px; &quot;&gt;&lt;a href=&quot;/&quot;&gt;&amp;lt; Back to Homepage&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px; &quot;&gt;Any questions? TheBabyShop.com Customer Support Team is here to help, 9 am to 5:30 pm, Monday to Friday&lt;br /&gt;\r\n(excluding public holidays).&amp;nbsp;Email&amp;nbsp;&lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt;&amp;nbsp;or call us at (+852) 2812-2223.&lt;/p&gt;\r\n&lt;/div&gt;\r\n', '', '', ''),
(13, 1, 'FAQs', '&lt;h1&gt;Frequently Asked Questions&lt;/h1&gt;\r\n\r\n&lt;p&gt;Here at The Baby Shop, one of our top priorities is to address all your concerns. We’ve compiled the list of our most frequently asked questions to help you understand the workings of The Baby Shop and put your mind at ease. Please contact us at &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; if our questions cannot address your concerns. We also appreciate all your feedbacks and suggestions to allow us serve you better.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;General&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#where-are-your-product-from&quot;&gt;Where are your products from?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#Is-your-gift-wrap-service-free-of-charge&quot;&gt;Is your gift wrap service free of charge?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#order&quot;&gt;How do I make a gift order?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#whydo&quot;&gt;Why do I need to register &amp;amp; sign-in before making a purchase?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#wheretoship&quot;&gt;Where can Baby Shop ship?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;PAYMENT&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#1&quot;&gt;What payment methods do you accept?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#2&quot;&gt;How secure is your payment system?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#3&quot;&gt;Do you store credit card information?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#4&quot;&gt;How do I know if I''ve been charged for my order?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#5&quot;&gt;Why do you need my phone and address information?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#7&quot;&gt;I placed an order. Can I change the payment method?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#8&quot;&gt;I placed an order. Can I add an item?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;&lt;a href=&quot;/faqs#10&quot;&gt;What is Baby Shop Credit?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;&lt;a href=&quot;/faqs#11&quot;&gt;How do I use my Baby Shop Credit?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Shipping&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#12&quot;&gt;How long will it take to get my order?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#13&quot;&gt;How do I check my order status?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#14&quot;&gt;What delivery methods does Baby Shop use?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#15&quot;&gt;Is there any shipping fees?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#16&quot;&gt;What happens if I need to change my order?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#17&quot;&gt;Do you ship to PO Boxes?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#18&quot;&gt;Does The Baby Shop ship internationally?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#19&quot;&gt;Will my entire order be shipped in one package?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;&lt;a href=&quot;/faqs#20&quot;&gt;How do I track my shipment?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Returns&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#21&quot;&gt;What''s The Baby Shop''s return policy?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#22&quot;&gt;How can I initiate the return process?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#23&quot;&gt;What if my order arrives incomplete, incorrect, damaged or defective?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#24&quot;&gt;What if I cannot find the Return Slip?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;&lt;a href=&quot;/faqs#25&quot;&gt;What if I am the recipient of the gift order, can I return this?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;strong&gt;Account&lt;/strong&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#26&quot;&gt;How do I unsubscribe from your newsletter email?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#27&quot;&gt;I forgot my password. Can you help?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#28&quot;&gt;How do I change my password?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#29&quot;&gt;How do I change my email address?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a href=&quot;/faqs#30&quot;&gt;How do I earn store credit?&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a name=&quot;where-are-your-product-from&quot;&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Where are your products from?&lt;/h2&gt;\r\n\r\n&lt;p&gt;We search far and wide to find great products. We only work with European brands that already sell in shops in Europe. That means all the products we carry must pass through the most stringent European safety requirements (such as the EN-71 - the European required, golden standard for toy safety). Our clothing brands that we carry come from the unique styles of all parts of Europe, including United Kingdom, France, Germany, Spain, Italy, and Sweden, just to name a few. Our toy brands often carry a long history of more than 100 years old and have strong developmental values. We love our products as they are safe and thoughtful in their designs.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a name=&quot;Is-your-gift-wrap-service-free-of-charge&quot;&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Is your gift-wrap service free of charge?&lt;/h2&gt;\r\n\r\n&lt;p&gt;Yes! We offer all our customers gift-wrap service free of charge. Depending on the size and type of the merchandize, we would determine the appropriate gift packaging, such as gift-wrap paper and gift box choice. That way, you, as a “gift-er”, do not need to worry about the nuances of finding wrapping paper to wrap the gift yourself. At the same time, there are certain large-sized items that are simply too large for us to provide the gift-wrap service. We apologize for any potential inconvenience. For all gift orders, you also have a complimentary message card (free) to make the gift even more personal.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;order&quot;&gt;How do I make a gift order?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;It''s simple. During the checkout process, as you review the list in your shopping cart, you will be able find the Gift-Wrap option near the bottom left corner. Just check that box and type a message, and we will provide the free gift-wrap service to you for your gift order.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;whydo&quot;&gt;Why do I need to register &amp;amp; sign-in before making a purchase?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;There are many services that we provide to our members with user accounts. That includes tracking the order, option to change order, option to return any merchandise, earned store credits (coming soon), saving the shopping cart, and tailored recommendations of our offerings. We work hard to ensure all our customers can enjoy a great user experience through our consistent customer services.&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;wheretoship&quot;&gt;Where can The Baby Shop ship?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;We ship to all address locations in Hong Kong, including Hong Kong Island, Kowloon, New Territories, and Outlying Islands. International shipping is also available throughout Asia, Europe, and North America! At this moment, we cannot ship to Africa, South America and certain countries. We will strive to increase our geographical reach in future.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;PAYMENT&lt;/h2&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;1&quot;&gt;What payment methods do you accept?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;We currently accept Visa, MasterCard, American Express, and PayPal payment. UnionPay and AliPay are coming soon. In future, you may also use Baby Shop Credit that you can obtain from promotional schemes and return merchandise.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;2&quot;&gt;How secure is your payment system?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;For all transactions, we use the PayPal online payment gateway, which is the gold standard for credit card transaction globally. PayPal is PCI-compliant, which means the system is highly secure at protecting your payment and credit card information according to international standards.&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;3&quot;&gt;Do you store credit card information?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;We do not store your credit card information for security reasons. All your credit card information is directly passed to PayPal via a secure protocol. PayPal conducts the actual processing of your credit card.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;4&quot;&gt;How do I know if I''ve been charged for my order?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;As soon as your order is placed, we authorize the card for the full order value and charge your card immediately. You will be notified via an order confirmation email from us.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;5&quot;&gt;Why do you need my phone and address information?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;Because the delivery person needs your shipping address and may attempt to call you before delivering you the order. The payment gateway requires your billing address for the secure processing of your credit card.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;7&quot;&gt;I placed an order. Can I change the payment method?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;Unfortunately, the credit card is charged when you place the order. Thus, it is not possible to change the payment method after the order is placed and confirmed.&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;8&quot;&gt;I placed an order. Can I change any of the order details?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;We try to be helpful where we can. Please email &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; or call us at +852-2812-2223 to make the request, and we will determine whether we can fulfill your request on a case-by case basis.&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;10&quot;&gt;What is The Baby Shop Credit?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;The Baby Shop Credit is coming soon. It is a way for user to pay for your purchases. The Baby Shop Credits can be received through a variety of methods, including referral rewards, gift cards and returned orders.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;11&quot;&gt;How do I use my credit from The Baby Shop?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;When The Baby Shop Credit is available on our website, there is an automatic mechanism in place to utilise The Baby Shop Credit. During payment on the website, our system will automatically deduct your purchase order value by your available The Baby Shop Credit balance. The Baby Shop Credits may be used for purchasing any items on the website except for Gift Cards.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Shipping&lt;/h2&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;12&quot;&gt;How long will it take to get my order?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;For all local Hong Kong shipping, you should receive your order within 2 to 3 business days (unless black rain or typhoon). For international orders, it depends on the country location. Within Asia, we can normally deliver your product within 7 to 10 days. For all other countries, the shipment days can be up to 20 days.&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;13&quot;&gt;How do I check my order status?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;After logging in, you can go to “My Account”, which is located near top right corner of this website. And then select “Order History”. If you would like to have further information, you can email us at &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; with your order number, we can provide you the latest status and courier / postal tracking number.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;14&quot;&gt;What delivery methods does The Baby Shop use?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;We delivery is made by trusted, highly professional service partners. For local Hong Kong service, we use the Hongkong Post or professional courier service (Yamato and SF Express) based on the delivery needs. For international delivery, we use a combination of postal services (Singapore Post, Hongkong Post) and international courier services (DHL, Fedex, SF Express) depending on the country location.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;15&quot;&gt;Is there any shipping fees?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;For all shipments to addresses in Hong Kong and regional places in Asia (Greater China, Taiwan, Singapore, Malaysia, Thailand, Indonesia, Philippines, Vietnam), we deliver completely FREE of all delivery charges. For other places around the world, we charge a flat fee per order.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;16&quot;&gt;What happens if I need to change my order?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;We try to be helpful where we can. Please email &lt;a href=&quot;mailto:support@thebabyshop.com&quot;&gt;support@thebabyshop.com&lt;/a&gt; or call us at 2812-2223 to make the request, and we will determine whether we can fulfill your request on a case-by case basis.&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;17&quot;&gt;Do you ship to PO Boxes?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;Yes, we ship to PO Boxes and all address locations of your choice. However, please check with the administrator of your PO Boxes whether you can accept medium to large-sized parcels, as we do not want you to be disappointed for being able to receive your purchased items from us.&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;18&quot;&gt;Does The&amp;nbsp;Baby Shop ship internationally&amp;nbsp;?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;We are shipping international soon. Please stay tuned! also available throughout Asia, Europe, and North America! At this moment, we cannot ship to Africa, South America and certain countries. We will strive to increase our geographical reach in future. If you have an urgent order that you would like to make internationally but not sure if our service covers, please send us an email at &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt;. We''ll try to accommodate where we can.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;19&quot;&gt;Will my entire order be shipped in one package?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;We strive to consolidate products in a single package. In most cases, your entire order will come in one package unless the entire order is too bulky to be shipped in one package.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;20&quot;&gt;How do I track my shipment?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;You can email us at &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; with your order number, we can provide you the latest status and courier / postal tracking number for you to better keep track of your shipment.&lt;/p&gt;\r\n\r\n&lt;h2&gt;Returns&lt;/h2&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;21&quot;&gt;What''s The Baby Shop''s return policy?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;We want you to have a great online shopping experience every time. You as customer can return any purchase, for whatever reason, for a full refund from The Baby Shop. All we ask is that you send the items back to us in the original packaging with product tags attached, and make sure that the merchandise is in the same condition you received it in. We have a standard 30-day policy, which means you should return your merchandise within 30 days of purchase.&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;22&quot;&gt;How can I initiate the return process?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p&gt;&lt;u&gt;There is a simple 3-step process: &lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;â€¢ &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;u&gt;Step 1: Fill Out Return Slip that comes with the package you received.&lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;â€¢&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;u&gt;Step 2: Place the Return Slip and returned merchandise into the same package that you received.&lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &lt;u&gt;Step 3: Ship it to the address indicated in the Return Slip.&lt;/u&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;23&quot;&gt;What if my order arrives incomplate, incorrect, damaged or defective?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;We trust the integrity of our customers. If the order is indeed incorrect, damaged, or defective, please send us return the merchandise to us with the Return Slip, and we would ship you the new one. If the order arrives incomplete or missing, mail us the Return Slip or please send us an email with your order number. We would immediately launch an internal investigation. Once the investigation is completed and we found that we did not ship you the right merchandise, we will ship you the incomplete order once the investigation has been completed (usually within a few days).&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;24&quot;&gt;What if I cannot find the Return Slip?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;You can &lt;strong&gt;&lt;u&gt;&lt;a alt=&quot;Return Slip&quot; href=&quot;/download/return_slip.pdf&quot; target=&quot;_blank&quot;&gt;click here&lt;/a&gt;&lt;/u&gt;&lt;/strong&gt;&amp;nbsp;to download and print out the Return Slip.&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;25&quot;&gt;What if I am the recipient of the gift order, can I returns this?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;Please note that if this item is a gift from somebody, as the recipient of the gift, you are only eligible for returns if the product arrives damaged or defective. In that case, please follow the standard return procedures. We would then send you a new product in return.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;Account&lt;/h2&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;26&quot;&gt;How do I unsubscribe from your newsletter email?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;We are sorry to trouble you. You can unsubscribe by clicking on the link at the bottom of the newsletter email, and follow the subsequent instructions to unsubscribe. Alternatively, you can send us an email to &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; and we will handle your request in a quick manner.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;27&quot;&gt;I forgot my password. Can you help?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;Yes. When you click “Login” near the top right corner of this website, a login screen will pop up. You can click on the “Forgotten Password” link in that login screen. Our system will send you an email to instruct your how to reset your password.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;28&quot;&gt;How do I change my password?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;Click on “My Account” near the top right corner of this website. Then select “Password” link where you can change your password.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;29&quot;&gt;How do I change my email address?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;Click on “My Account” near the top right corner of this website. Then select “Edit Account” where you can change your email.&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;&lt;a name=&quot;30&quot;&gt;How do I earn The Baby Shop Credit (store credit)?&lt;/a&gt;&lt;/h2&gt;\r\n\r\n&lt;p style=&quot;font-size: 13px;&quot;&gt;The Baby Shop Credit will arrive soon. You cannot earn The Baby Shop Credit in the meantime.&lt;/p&gt;\r\n', '', '', '');
INSERT INTO `store_information_description` (`information_id`, `language_id`, `title`, `description`, `custom_title`, `meta_description`, `meta_keyword`) VALUES
(5, 1, 'Terms', '&lt;h1&gt;Terms &amp;amp; Conditions&lt;/h1&gt;\r\n\r\n&lt;p&gt;These Terms and Conditions of Service (“Terms of Service”) govern your user account on TheBabyShop.com and its associated mobile sites (“The Baby Shop Sites”, “Baby Shop Sites”, “Sites”, or “TheBabyShop.com”) and your purchases and use of products and services available through the Baby Shop Sites. The Baby Shop Sites are operated by The Baby Shop International Limited (“The Baby Shop” or “Baby Shop” or “We”). Your use of the Baby Shop Sites and these terms are also governed by the Website Terms of Use (“Terms of Use”), which are incorporated herein by reference.&lt;/p&gt;\r\n\r\n&lt;p&gt;By establishing user account on the Baby Shop Sites, or purchasing or using products or services through the Baby Shop Sites, you acknowledge and agree as follows:&lt;/p&gt;\r\n\r\n&lt;h2&gt;GENERAL&lt;/h2&gt;\r\n\r\n&lt;p&gt;These Terms of Service have been executed and delivered by you and constitute a valid and binding agreement between you and The Baby Shop. You represent that you are at least 18 years of age, and are legally capable of forming a binding contract.&lt;/p&gt;\r\n\r\n&lt;p&gt;You shall establish and use your user account on the Baby Shop Sites, and purchase and use the products and services available through the Baby Shop Sites, in compliance with these Terms of Service and all applicable laws, rules and regulations (collectively, “Laws”).&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;PRIVACY POLICY&lt;/h2&gt;\r\n\r\n&lt;p&gt;A copy of the Privacy Policy that applies to the collection, use, disclosure and other processing of personal information by The Baby Shop is located at&amp;nbsp; &amp;nbsp;&lt;a alt=&quot;The Baby Shop Privacy&quot; href=&quot;/privacy&quot;&gt;www.thebabyshop.com/privacy&lt;/a&gt;. You consent to any personal information we may obtain about you (either via the Baby Shop Sites, by email, telephone or any other means) being collected, stored and otherwise processed in accordance with the terms of the Privacy Policy. The Baby Shop may update its Privacy Policy from time to time and post an updated version of the notice at the website address provided above.&lt;/p&gt;\r\n\r\n&lt;h2&gt;THE BABY SHOP USER ACCOUNT&lt;/h2&gt;\r\n\r\n&lt;h3&gt;Establishing a User Account&lt;/h3&gt;\r\n\r\n&lt;p&gt;You may establish user account on The Baby Shop Sites. Enrollment requires you to (1) indicate agreement to these Terms of Service and (2) provide email or Facebook. We may request the submission of other form of authentication in The Baby Shop’s sole discretion. You agree to accept responsibility for all activities that occur under your account or password. You are responsible for maintaining the confidentiality of your account and password, and for restricting access to your account.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Use of User Account&lt;/h3&gt;\r\n\r\n&lt;p&gt;You shall not use your Baby Shop user account for any purpose competitive to The Baby Shop. You agree to notify Baby Shop immediately by emailing &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; of any unauthorized use of your Baby Shop user account.&lt;/p&gt;\r\n\r\n&lt;h3&gt;User Account Termination&lt;/h3&gt;\r\n\r\n&lt;p&gt;You may cancel your Baby Shop user account at any time by sending us your request via email to &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt;. Baby Shop may terminate your user account and refuse any and all current or future use of the Baby Shop Sites or other services, or any portion thereof, (1) in order to comply with applicable Law, (2) if you provide any information that The Baby Shop determines, in its sole discretion, to be untrue, inaccurate, not current or incomplete (or if the information becomes untrue, inaccurate, not current or incomplete), (3) if The Baby Shop determines, in its sole discretion, that you are using your Baby Shop user account in a manner not permitted by these Terms of Service or the Terms of Use, or (4) in other circumstances, as The Baby Shop deems appropriate in its sole discretion. Please note that termination by you or The Baby Shop of your Baby Shop user account may result in the termination of your user accounts in The Baby Shop’s affiliated websites.&lt;/p&gt;\r\n\r\n&lt;h2&gt;PURCHASES&lt;/h2&gt;\r\n\r\n&lt;h3&gt;Order Processing&lt;/h3&gt;\r\n\r\n&lt;p&gt;The Baby Shop may, in its sole discretion, choose to not process or to cancel your order in certain circumstances. This may occur, for example, when the product or service you wish to purchase is out of stock or has been mispriced, we suspect the request is fraudulent, or in other circumstances Baby Shop deems appropriate in its sole discretion. Baby Shop also reserves the right, in its sole discretion, to take steps to verify your identity to process your order. Baby Shop will either not charge you or refund the charges for orders that we do not process or cancel.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Product and Service Descriptions&lt;/h3&gt;\r\n\r\n&lt;p&gt;The Baby Shop attempts to provide accurate descriptions of products and services on The Baby Shop Sites. The Baby Shop does not warrant, however, that the descriptions are accurate, complete, reliable, current or error-free.&amp;nbsp;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h3&gt;Pricing Information&lt;/h3&gt;\r\n\r\n&lt;p&gt;TThe Baby Shop strives to provide accurate pricing information regarding the products and services available on the Baby Shop Sites. We cannot, however, insure against pricing errors. The Baby Shop reserves the right, at its sole discretion, to not process or to cancel any orders placed for a product or service whose price was incorrectly posted on the site as a result of an error. If this occurs, The Baby Shop will notify you by email. In addition, The Baby Shop reserves the right, at its sole discretion, to correct any error in the stated full retail price.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Product and Service Availability&lt;/h3&gt;\r\n\r\n&lt;p&gt;The Baby Shop Sites may contain information regarding the availability of merchandise. This information can be used to estimate the likelihood that an item will be shipped immediately after you place your order. Unfortunately, The Baby Shop cannot guarantee that an item listed as “in stock” will actually ship right away, as inventory can change significantly from day-to-day. In rare cases, a product or service offering may be in stock when a customer places the order, and sold out by the time The Baby Shop attempts to process the order. Should this happen, The Baby Shop will notify you by email. If The Baby Shop determines that a product or service you wish to purchase is no longer available, the item will be cancelled from your order. The Baby Shop will notify you by email.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Gift Orders&lt;/h3&gt;\r\n\r\n&lt;p&gt;We offer gift-wrap service for free for your gift orders where possible. When available, select the gift-wrap option in the checkout page and we will do the work for you. Gifts are wrapped in our signature blue box with white ribbon. We apologize that some items cannot be gift wrapped such as large nursery items or travel gear.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Payment&lt;/h3&gt;\r\n\r\n&lt;p&gt;We accept payment from major credit cards, including Visa, MasterCard, and American Express using the PayPal payment gateway. Credit card is charged upon completion of the checkout process. We also accept direct payment from your PayPal account.&lt;/p&gt;\r\n\r\n&lt;p&gt;You will have a chance to verify the information in checkout and, if no changes are necessary, proceed to &quot;Checkout&quot;. You will receive a confirmation e-mail that your order has been received within 24 hours and that we have charged your credit card. We will also send you another e-mail to notify you when your order has been shipped.&lt;/p&gt;\r\n\r\n&lt;p&gt;A foreign transaction may be charged by your card issuer for overseas credit cards.&lt;/p&gt;\r\n\r\n&lt;p&gt;While we use PayPal payment gateway, a PCI compliant service provider, we cannot be not responsible for your financial loss due to fraudulent attempt by other parties who utilise your credit card without your consent (“Financial Faurds”. Thus, you agree to be responsible for keeping your credit card information safe and not pursue us for financial losses due to Financial Frauds.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Standard Shipping and Handling&lt;/h3&gt;\r\n\r\n&lt;p&gt;Orders are processed once credit card authorization and verification have been obtained.&lt;/p&gt;\r\n\r\n&lt;p&gt;Hong Kong local orders are normally shipped with Hongkong Post or local services. All Hong Kong local orders are shipped without shipping free except for gift baskets. Please note that gift orders are different from gift baskets. All gift orders are still shipped without shipping fee.&lt;/p&gt;\r\n\r\n&lt;p&gt;International orders are shipped with Hongkong Post, Singapore Post, or other international courier services. Each international order has a flat shipping rate per order per country. &amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;p&gt;We have standard number of shipping days per country. While we strive to deliver your products within the standard number of shipping days to earn your customer satisfaction, due to unforeseeable circumstances, we cannot guarantee the number of shipping days for every single order.&lt;/p&gt;\r\n\r\n&lt;p&gt;You can only ship to one address each time you checkout. If you are shopping for people at different addresses, you will need to place each order separately.&lt;/p&gt;\r\n\r\n&lt;p&gt;All Baby Shop orders are subject to examinations from customs of the destination country and if chosen for such an exam, delivery time can be delayed.&lt;/p&gt;\r\n&lt;ph3&gt;Order Shipping Tracking\r\n&lt;p&gt;You can check the status of your order shipping status by sending us an email at &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; with your request and order number. We can provide you the latest updates with your order and the postal service or courier tracking number if available.&lt;/p&gt;\r\n\r\n&lt;h2&gt;RETURNS POLICY&lt;/h2&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;When we fall short of your expectation on our merchandise, we accept returns where possible to enforce our commitment of excellent service to all our customers.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you were not satisfied with the terms ordered for any reasons, you many receive a refund in the form of credit card, PayPal refund, or The Baby Shop Credits ( &quot; Baby Shop Refund Methods&quot;) to your user account, minus shipping costs, within 30days of purchase (shipmet date) on unused, in its original packing merchandise and with the product tag attached.&lt;/p&gt;\r\n\r\n&lt;h3&gt;Returns Process&lt;/h3&gt;\r\n\r\n&lt;p&gt;To return your merchandise, please kindly folow the steps described in the following link: &lt;u&gt;&lt;a href=&quot;/returns&quot;&gt;www.thebabyshop.com/returns&lt;/a&gt;&lt;/u&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;When we receive your returned merchandise and find no error, we will issue your refund using Baby Shop Refund Methods as soon as possible, minus shipping and mailing costs.&lt;/p&gt;\r\n\r\n&lt;p&gt;If any promotional discount or coupon code was applied to the total at the time of purchases, you will receive the full product value for that item with Baby Shop Refund Methods.&lt;/p&gt;\r\n\r\n&lt;p&gt;If you want to return an item received as a gift item and you&amp;nbsp;are the recipient of the gift, not the payer of thegift, you may not recive refund with the mentioned Baby Shop Refund Methods. However, if your merchandise is damaged or defect, you may follow the return process outlined in &lt;u&gt;&lt;a href=&quot;/returns&quot;&gt;www.thebabyshop.co/returns&lt;/a&gt;&lt;/u&gt;. We will then ship you a new item to replace your damaged or defect merchandise.&lt;/p&gt;\r\n\r\n&lt;p&gt;For any issues, concerns, or help requests, please contact&amp;nbsp;&lt;u&gt;&lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt;&lt;/u&gt;. We will be happy to assist you in returning your items.&lt;/p&gt;\r\n\r\n&lt;p&gt;Please refer to below for terms of use for The Baby Shop Credits.&lt;/p&gt;\r\n\r\n&lt;h2&gt;BABY SHOP CREDITS&lt;/h2&gt;\r\n\r\n&lt;p&gt;The BabyShop Credits are not yet availabe and will be available in the near future. Once The Baby Shop Credits are available, The Baby Shop user account holders are entitled to receive The Baby Shop Credits through a variety of methods, including referral rewards, gift cards and returned orders. The Baby Shop Credits may be used on TheBabyShop.com, but may not be used to purchase The Baby Shop Gift Cards.&lt;/p&gt;\r\n\r\n&lt;p&gt;During payment on TheBabyShop.com, our system will automatically deduct your purchase order value by your available The Baby Shop Credit balance.&lt;/p&gt;\r\n\r\n&lt;p&gt;The Baby Shop Credits may onlybe used for future purchase of products on TheBabyShop.com website (excluding gift cards) and are not transferable. The Baby Shop Credits have a one- year expiration time.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;h2&gt;ENTIRE AGREEMENT&lt;/h2&gt;\r\n\r\n&lt;p&gt;These Terms of Service constitute the entire agreement of between you and The Baby Shop regarding the specific matters herein, and all prior agreements, letters, proposals, discussions and other documents regarding the matters herein are superseded and merged into these Terms of Service. In the event there is a conflict between these Terms of Service and the Terms of Use with respect to the matters herein, these Terms of Service will control.&lt;/p&gt;\r\n\r\n&lt;h2&gt;SEVERABILITY&lt;/h2&gt;\r\n\r\n&lt;p&gt;If any provision of these Terms of Service enforceability of the remaining provisions shall not in any way be affected or impaired thereby, and such provision shall be deemed to be restated to reflect the parties’ original intentions as nearly as possible in accordance with applicable laws.&lt;/p&gt;\r\n\r\n&lt;h2&gt;MODIFICATION OF TERMS OF SERVICE&lt;/h2&gt;\r\n\r\n&lt;p&gt;You acknowledge and agree that The Baby Shop may, in its sole discretion, modify, add or remove any portion of these Terms of Service at any time and in any manner, including the terms of The Baby Shop user account, by posting revised Terms of Service on the Site. You may not amend or modify these Terms of Service under any circumstances. The current version of these Terms of Service is available at &lt;a alt=&quot;The Baby Shop Terms&quot; href=&quot;/terms&quot;&gt;www.thebabyshop.com/terms&lt;/a&gt;. It is your responsibility to check periodically for any changes we make to the Terms of Service. Your continued use of this Site after any changes to the Terms of Service means you accept the changes.&lt;/p&gt;\r\n\r\n&lt;h2&gt;EFFECT OF TERMINATION/SURVIVAL OF SELECTED PROVISIONS&lt;/h2&gt;\r\n\r\n&lt;p&gt;Notwithstanding the expiration or earlier termination of your Baby Shop user account, or any general legal principles to the contrary, any provision of these Terms of Service that impose or contemplate continuing obligations or rights of a party will survive expiration or termination of these Terms of Service.&lt;/p&gt;\r\n&lt;small&gt;Effective Date: June 21, 2013&lt;/small&gt;&lt;/ph3&gt;', '', '', ''),
(6, 1, 'Shipping', '&lt;h1 style=&quot;margin-bottom: 20px;&quot;&gt;FREE Shipping&lt;/h1&gt;\r\n\r\n&lt;h3&gt;100% FREE shipping from TheBabyShop.com&lt;/h3&gt;\r\n\r\n&lt;p&gt;TheBabyShop.com provides free shipping service to anywhere in Hong Kong, and for a limited time special offer, also to more than 50 countries&amp;nbsp;free of charge!&lt;/p&gt;\r\n\r\n&lt;div&gt;&lt;img alt=&quot;&quot; src=&quot;/image/data/information/thebabyshop_free_delivery.jpg&quot; style=&quot;opacity: 0.9; font-size: 13px; line-height: 1.6em; width: 300px; height: 300px; float: right; &quot; /&gt;&lt;/div&gt;\r\n\r\n&lt;p&gt;We understand that getting your items quickly is important to you. We make every effort to process your order quickly. For all local Hong Kong shipping, you should receive your order within 2 to 3 business days (unless black rain or typhoon). For international orders, it depends on the country location. Within Asia, we can normally deliver your product within 7 to 10 days. For all other countries, the shipment days can be up to 20 days.&lt;/p&gt;\r\n\r\n&lt;p&gt;We only use trusted local courier services. At any point, if you wish to track your order, contact &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; with your order number and we’ll provide you the latest updates and courier tracking number.&lt;/p&gt;\r\n\r\n&lt;p&gt;We currently cannot send to certain regions in the world. That includes Africa, South America, and some specific countries. We will continue to improve our international coverage.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n\r\n&lt;hr /&gt;\r\n&lt;p&gt;&lt;a href=&quot;/&quot;&gt;&amp;lt; Back to Homepage&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Any questions? TheBabyShop.com Customer Support Team is here to help, 9 am to 5:30 pm, Monday to Friday&lt;br /&gt;\r\n(excluding public holidays).&amp;nbsp;Email &lt;a href=&quot;mailto:info@thebabyshop.com&quot;&gt;info@thebabyshop.com&lt;/a&gt; or call us at (+852) 2812-2223.&lt;/p&gt;\r\n', '', '', ''),
(17, 1, 'Press', '&lt;h1 style=&quot;margin-bottom: 20px;&quot;&gt;Press&lt;/h1&gt;\r\n\r\n&lt;p&gt;Here is some of our recent media coverage&lt;/p&gt;\r\n\r\n&lt;p&gt;For media inquiries, please email us at &lt;a href=&quot;mailto:marketing@thebabyshop.com&quot;&gt;marketing@thebabyshop.com&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;div class=&quot;product-grid press&quot;&gt;\r\n&lt;div class=&quot;pbox&quot;&gt;\r\n&lt;div class=&quot;image&quot;&gt;&lt;a class=&quot;group9&quot; href=&quot;/image/data/information/press/20131101_playtime_1.jpg&quot;&gt;&lt;img src=&quot;/image/data/information/press/20131101_playtime_thumb.jpg&quot; width=&quot;170px&quot; /&gt; &lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;description&quot;&gt;Read the brand story about our founder, our product and our business in this month Playtimes magazine.&lt;/div&gt;\r\n\r\n&lt;div class=&quot;rating&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;brand&quot;&gt;Playtimes&lt;/div&gt;\r\n&lt;span class=&quot;name&quot;&gt;November 2013&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;pbox&quot;&gt;\r\n&lt;div class=&quot;image&quot;&gt;&lt;a class=&quot;group8&quot; href=&quot;/image/data/information/press/20131031_milkb_1.jpg&quot;&gt;&lt;img src=&quot;/image/data/information/press/20131031_milkb_thumb.jpg&quot; width=&quot;170px&quot; /&gt; &lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;description&quot;&gt;Our latest FW clothing.&lt;/div&gt;\r\n\r\n&lt;div class=&quot;rating&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;brand&quot;&gt;Milk B&lt;/div&gt;\r\n&lt;span class=&quot;name&quot;&gt;October 2013&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;pbox&quot;&gt;\r\n&lt;div class=&quot;image&quot;&gt;&lt;a class=&quot;group11&quot; href=&quot;/image/data/information/press/20131107_smart_parents_1.jpg&quot;&gt;&lt;img src=&quot;/image/data/information/press/20131107_smart_parents_thumb.jpg&quot; width=&quot;170px&quot; /&gt; &lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;description&quot;&gt;Smart Parents introduced our winter hats and scarfs to their little readers.&lt;/div&gt;\r\n\r\n&lt;div class=&quot;rating&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;brand&quot;&gt;Smart Parents&lt;/div&gt;\r\n&lt;span class=&quot;name&quot;&gt;November 2013&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;pbox&quot;&gt;\r\n&lt;div class=&quot;image&quot;&gt;&lt;a class=&quot;group4&quot; href=&quot;/image/data/information/press/2013-autumn_jessica_baby_1.jpg&quot;&gt;&lt;img src=&quot;/image/data/information/press/2013-autumn_jessica_baby_thumb.jpg&quot; width=&quot;170px&quot; /&gt; &lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;description&quot;&gt;Jessica Baby''s &quot;lifestyle news&quot; introduced our wooden toy brand.&lt;/div&gt;\r\n\r\n&lt;div class=&quot;rating&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;brand&quot;&gt;Jessica Baby&lt;/div&gt;\r\n&lt;span class=&quot;name&quot;&gt;Autumn 2013&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;pbox&quot;&gt;\r\n&lt;div class=&quot;image&quot;&gt;&lt;a class=&quot;group10&quot; href=&quot;/image/data/information/press/20131101_lisa_1.jpg&quot;&gt;&lt;img src=&quot;/image/data/information/press/20131101_lisa_thumb.jpg&quot; width=&quot;170px&quot; /&gt; &lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;description&quot;&gt;Our favorite dress from Jessie &amp;amp; James featured as &quot;plaid fanatic&quot; choice for kids.&lt;/div&gt;\r\n\r\n&lt;div class=&quot;rating&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;brand&quot;&gt;Lisa 味道生活&lt;/div&gt;\r\n&lt;span class=&quot;name&quot;&gt;November 2013&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;pbox&quot;&gt;\r\n&lt;div class=&quot;image&quot;&gt;&lt;a class=&quot;group6&quot; href=&quot;/image/data/information/press/20131018_scmp_supplement_1.jpg&quot;&gt;&lt;img src=&quot;/image/data/information/press/20131018_scmp_supplement_thumb.jpg&quot; width=&quot;170px&quot; /&gt; &lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;description&quot;&gt;SCMP''s special report selected our clothing brands in this year''s kids fashion trend.&lt;/div&gt;\r\n\r\n&lt;div class=&quot;rating&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;brand&quot;&gt;South China Morning Post Special Report&lt;/div&gt;\r\n&lt;span class=&quot;name&quot;&gt;October 2013&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;pbox&quot;&gt;\r\n&lt;div class=&quot;image&quot;&gt;&lt;a class=&quot;group7&quot; href=&quot;/image/data/information/press/20131031_smart_parents_1.jpg&quot;&gt;&lt;img src=&quot;/image/data/information/press/20131031_smart_parents_thumb.jpg&quot; width=&quot;170px&quot; /&gt; &lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;description&quot;&gt;Our latest FW clothing featured in New Papa Mama and Smart spending.&lt;/div&gt;\r\n\r\n&lt;div class=&quot;rating&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;brand&quot;&gt;Smart Parents&lt;/div&gt;\r\n&lt;span class=&quot;name&quot;&gt;October 2013&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;pbox&quot;&gt;\r\n&lt;div class=&quot;image&quot;&gt;&lt;a class=&quot;group12&quot; href=&quot;/image/data/information/press/20131108_mommys_express_weekly_1.jpg&quot;&gt;&lt;img src=&quot;/image/data/information/press/20131108_mommys_express_weekly_thumb.jpg&quot; width=&quot;170px&quot; /&gt; &lt;/a&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;description&quot;&gt;Smart Parents introduced our winter hats and scarfs to their little readers.&lt;/div&gt;\r\n\r\n&lt;div class=&quot;rating&quot;&gt;&amp;nbsp;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;brand&quot;&gt;Mommy''s Express Weekly&lt;/div&gt;\r\n&lt;span class=&quot;name&quot;&gt;November 2013&lt;/span&gt;&lt;/div&gt;\r\n\r\n&lt;div class=&quot;pbox&quot;&gt;\r\n&lt;div class=&quot;image&quot;&gt;&lt;a class=&quot;group5&quot; href=&quot;/image/data/information/press/20131017_smart_parents_1.jpg&quot;&gt;&lt;img src=&quot;/imag