INSERT INTO `store_product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `tag`, `custom_title`) VALUES
(4354, 1, 'Wooden Colour Stacking Cubes', '&lt;p&gt;A first do-it-yourself project for your clever little one! The six blocks fit together in pairs. In order to complete the task, little thinkers have to try over and over to find the right combination. This stacking cube set promotes motor skills and early problem solving of your little one.&lt;/p&gt;&lt;p&gt;Age:12m+&lt;/p&gt;', '', '', '', ''),
(4355, 1, 'Wooden Lacing Cubes', '&lt;p&gt;Threading, screwing, sticking. This is a cubes set with six blocks, a threader and three challenges! In order to connect two matching blocks, small puzzlers have to thread, screw and stick. This fun toy promotes fine motor skills and early problem solving skills.&lt;/p&gt;&lt;p&gt;Age:18m+&lt;/p&gt;', '', '', '', ''),
(4356, 1, 'Wooden Build And Play Car', '&lt;p&gt;This play car is an ideal toy for your little mechanic! With a little ingenuity, auto parts, wheels and screws can be turned into a whole car that really drives. The car parts can be combined in different ways, and a child can easily grasp the red handle of the car. After putting it all together, it???time for a little joyride. This promotes fine motor skills learning and logical thinking.&lt;/p&gt;&lt;p&gt;Age:18m+&lt;/p&gt;', '', '', '', ''),
(4357, 1, 'Wooden Multi-Activity Triangle', '&lt;p&gt;This is a discovery box with 4 bricks. Playing can be so fun and exciting! Moving cog, pushing ovals here and there, putting different stones through various openings and reaching through rubber bands. This fun toy trains your little one???fine motor skills and pattern recognition on shapes and objects. &lt;/p&gt;&lt;p&gt;Age:18m+&lt;/p&gt;', '', '', '', ''),
(4358, 1, 'Testing Product', '&lt;p&gt;Testing Product&lt;/p&gt;\r\n', 'Testing Product', 'Testing Product', 'Testing Product', 'Testing Product'),
(4347, 1, 'Wooden Rattle Teether', '&lt;p&gt;This flexible grasping toy is a high quality German-made wooden teether that is 100% safe for your little one to lick and bite on. In addition to big, colourful balls and a rattle ring, it also has a soft bite-resistant roll, made of BPA-free silicone.&lt;/p&gt;&lt;p&gt;Age:0m+&lt;/p&gt;', '', '', '', ''),
(4348, 1, 'Wooden Mouse Rattle', '&lt;p&gt;Grasping is fun! This lovely rattle is exactly what baby???little hands will enjoy. It will occupy your baby???for a long time as they will explore its rattling ears, which are easy and comfortable to grip from all angles. Thanks to its light weight, it is ideal for a baby???first touching and feeling attempts. This makes a great gift for baby showers.&lt;/p&gt;&lt;p&gt;Age:0m+&lt;/p&gt;', '', '', '', ''),
(4349, 1, 'Wooden Handheld Rattle', '&lt;p&gt;Grasping is fun! This lovely rattle is exactly what baby???little hands will enjoy. The colourful balls, which move, but cannot fall out, are hidden under a beautiful blue sky. They rattle softly catching baby?s attention. This lovely rattle stimulates all the senses: seeing, hearing, feeling and self-discovery with a mirror on the bottom to keep baby''s interest.&lt;/p&gt;&lt;p&gt;Age:0m+&lt;/p&gt;', '', '', '', ''),
(4350, 1, 'Little Wooden Car', '&lt;p&gt;This German-made, little wooden car puts your child at the driver???seat. A little push from your little one is all it takes to send the car speeding away. This fabulous car encourages your child???skills and creativity.&lt;/p&gt;&lt;p&gt;Age:6m+&lt;/p&gt;', '', '', '', ''),
(4351, 1, 'Giraffe Wooden Car', '&lt;p&gt;The little giraffe grasping toys create excitement in every baby bedroom. One little push is enough for the giraffe to race away. The cuddly, round grasping toy stimulates your little one???senses and motivates to touch. Your baby will have hours of fun playing it again and again.&lt;/p&gt;&lt;p&gt;Age:6m+&lt;/p&gt;', '', '', '', ''),
(4352, 1, 'Wooden Funny Stacking Animals', '&lt;p&gt;You can thread them or stack them! These four colourful friends are always in good shape. With the threading aid, even the little ones manage to thread the donkey, dog, cat and rooster on top of each other. That is great stacking toy that promotes motor skills and color recognition ability.&lt;/p&gt;&lt;p&gt;Age:18m+&lt;/p&gt;', '', '', '', ''),
(4353, 1, 'Colour Stacking Blocks', '&lt;p&gt;This is more than just stacking! This stacking game with hexagonal blocks of varying width offers countless ways of stacking both horizontally and vertically. This creates a wide range of building options whose construction requires and promotes creativity, patience, concentration and fine motor skills.&lt;/p&gt;&lt;p&gt;Age:24m+&lt;/p&gt;', '', '', '', '');
